import React from 'react';
import logo from './logo.svg';
import './App.css';

import Title from "./components/title"
import Results from './components/results'

function App() {
  return (
    <div className="App">

        <Title />

      <header className="App-header">
        <Results />
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React?
        </a>
      </header>
    </div>
  );
}

export default App;
